contracts/Vault.sol.content:
//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/extensions/AccessControlEnumerable.sol";
import "hardhat/console.sol";

contract Vault is Ownable(msg.sender) , AccessControlEnumerable {

    IERC20 private token;
    uint256 public maxWithdrawAmount;
    bool public withdrawEnabled;
    bytes32 public constant WITHDRAWER_ROLE = keccak256("WITHDRAWER_ROLE");


    constructor(){
        // khởi tạo logic khác nếu cần
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function setWithdrawEnabled(bool _isEnabled) public onlyOwner {
        withdrawEnabled = _isEnabled;
    }

    function setMaxWithdrawAmount(uint256 _amount) public onlyOwner {
        maxWithdrawAmount = _amount;
    }

    function setToken(IERC20 _token) public onlyOwner {
        token = _token;
    }

    function withdraw(uint256 _amount, address _to) external onlyRole(WITHDRAWER_ROLE) {
        require(withdrawEnabled, "Withdraw is not enabled");
        require(_amount <= maxWithdrawAmount, "Exceeds max withdraw amount");

        SafeERC20.safeTransfer(token, _to, _amount);
    }

    function deposit(uint256 _amount) external {
        require(token.balanceOf(msg.sender) >= _amount, "Insufficient balance");

        SafeERC20.safeTransferFrom(token, msg.sender, address(this), _amount);
    }

    modifier onlyWithdrawer() {
        require(hasRole(WITHDRAWER_ROLE, _msgSender()) || owner() == _msgSender(), "Caller is not a withdrawer");
        _;
    }

}

